import base64
from io import BytesIO

import pytest
from core.comms.entrypoint import utils


def test_get_image_bytes_from_html():
    raw_html = """
                <p>
                Hello, This is some random string!
                <img src="data:image/png;base64, alt="QR Code" />
                </p>
                """

    image_bytes = """"""

    buffer = BytesIO()
    buffer.write(base64.b64decode(image_bytes))
    image_bytes = buffer.getvalue()
    buffer.close()

    assert utils.get_image_bytes_from_html(raw_html) == image_bytes
    assert utils.get_image_bytes_from_html(raw_html + "<h1>sdasdd</h1>") == image_bytes
    assert utils.get_image_bytes_from_html("not a valid html") is None
    assert utils.get_image_bytes_from_html("") is None
    assert utils.get_image_bytes_from_html("<p>asdad</p>") is None
    assert utils.get_image_bytes_from_html(raw_html.replace("png", "jpeg")) == image_bytes


def test_decompose_img_tag():
    assert utils.decompose_img_tag("<p>asdad</p>") == "<p>asdad</p>"
    assert utils.decompose_img_tag("<p>asdad<img src='blablabla'/></p>") == "<p>asdad</p>"
